function getActiveItemId(){
	var itemsFound = document.getElementsByClassName("active center");
	if ( itemsFound !== null && itemsFound.length === 1){
		return "" + itemsFound[0].childNodes[0].id;
	}
}

function addLoadEvent(func) {
    var oldonload = window.onload;
    if (typeof window.onload != 'function') {
        window.onload = func;
    } else {
        window.onload = function() {
            if (oldonload) {
            	oldonload();
            }
            func();
        };
    }
}